<?php
function imed_app_share($self) {
	R::View('imed.toolbar',$self,'เครือข่าย','none');

	$ui = new Ui(NULL,'link-banner');

	$ui->add('<a href="http://www.scf.or.th?target=browser"><img src="https://scf.or.th/upload/pics/scf-logo.jpg" />มูลนิธิชุมชนสงขลา</a>');
	$ui->add('<a href="http://www.songkhlapao.go.th?target=browser"><img src="https://communeinfo.com/upload/org/org-logo-325.png" />อบจ.สงขลา</a>');
	$ui->add('<a href="https://kongthun-sk.com?target=browser"><img src="data:image/png;base64," />กองทุนฟื้นฟูสมรรถภาพที่จำเป็นต่อสุขภาพ จังหวัดสงขลา</a>');

	$ret .= $ui->build();

	$ret .= '<style type="text/css">
	.link-banner {list-style-type: none; margin: 0; padding: 0px 0; text-align: center;}
	.link-banner>li {margin: 0}
	.link-banner a {margin: 32px 0; padding: 16px 4px; display: block; background-color: #fff;}
	.link-banner img {height: 100px; display: block; margin: 0 auto;}
	</style>';
	return $ret;
}
?>